import { useParams } from "react-router-dom";


export default function ViewIngredient(props){
let extra = useParams();
let inventory = props.inventory;
return (
    <div>
    {Object.keys(inventory[extra.name]).map(key => (
        <span>{key+", "+props.inventory[key]}</span>
    ))}
    </div>
);
}

